import React, { Component } from "react";
import axios from "axios";

class Fetch extends Component {
  constructor(props) {
    super(props);
    this.state = {
      Posts: []
    };
  }

  componentDidMount() {
    axios
      .get(" http://127.0.0.1:8000/posts/ ")
      .then(response => {
        console.log(response);
        this.setState({ Posts: response.data });
      })
      .catch(error => {
        console.log(error);
      });
  }

  render() {
    const { Posts } = this.state;
    return (
      <ol>
        {Posts.map(post => (
          <li key={post.name}>{post.post}</li>
        ))}
        {Posts.map(post => (
          <li key={post.name}>{post.author}</li>
        ))}
      </ol>
    );
  }
}

export default Fetch;
